import './App.css';

function LoginSign() {
  return (
    <>
      <div className='whiteScreen'>
          <div class="inside">

            <div className='buttons'>
                <button className="button1">Login</button>
                <button className='button2'>Sign Up</button>
            </div>
          </div>
      </div>
      <img src='my-app/src/IMG/randomlogo.png' alt=''></img>
    </>
  );
}

export default LoginSign;
